    // Creating a method that will create the view using the collection of objects provided in String
    @Override
    protected void onCreate(Bundle savedInstanceState) {
        requestWindowFeature(Window.FEATURE_NO_TITLE);
        this.getWindow().setFlags(WindowManager.LayoutParams.FLAG_FULLSCREEN,WindowManager.LayoutParams.FLAG_FULLSCREEN);
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_medicine_search);
        atv=(AutoCompleteTextView) findViewById(R.id.atv);
        atv2=findViewById(R.id.atv2);
        btn= findViewById(R.id.btn_save);
        member=new Member();
        String strEmail = getIntent().getStringExtra("email");
        reference= database.getInstance().getReference().child("users").child(strEmail).child("medicationList");
        atv.setAdapter(new ArrayAdapter(MedicineSearch.this, android.R.layout.simple_list_item_1,
                name));
        reference.addListenerForSingleValueEvent(new ValueEventListener() {
            @Override
            public void onDataChange(@NonNull DataSnapshot dataSnapshot) {
                if(dataSnapshot.exists()){
                    for (int i = 1 ; i < (int)dataSnapshot.getChildrenCount() + 2 ; i++) {
                        if (!dataSnapshot.hasChild(String.valueOf(i))){
                            maxid = i;
                            break;
                        }
                    }
                }
            }

            @Override
            public void onCancelled(@NonNull DatabaseError error) {

            }
        });

        btn.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View view) {
                Query medicineQuery = FirebaseDatabase.getInstance().getReference().child("users").child(strEmail).child("medicationList").orderByChild("name").equalTo(atv.getText().toString());//.child(strEmail).child("medicationList");

                medicineQuery.addListenerForSingleValueEvent(new ValueEventListener() {
                    @Override
                    public void onDataChange(@NonNull DataSnapshot snapshot) {
                        if (snapshot.exists())
                            Toast.makeText(MedicineSearch.this, "Medicine already stored", Toast.LENGTH_SHORT).show();
                        else {
                            member.setAtv(atv.getText().toString());
                            if((atv.getText().toString()).equals("") || (atv2.getText().toString()).equals("")){
                                Toast.makeText(MedicineSearch.this,"Add Some Value", Toast.LENGTH_SHORT).show();
                            }
                            else {
                                Toast.makeText(MedicineSearch.this, "Medicine stored successfully", Toast.LENGTH_SHORT).show();

                                reference.child(String.valueOf(maxid)).child("name").setValue(atv.getText().toString());
                                reference.child(String.valueOf(maxid)).child("invCount").setValue(atv2.getText().toString());
                                openmain_activity2();
                            }
                        }
                    }

                    @Override
                    public void onCancelled(@NonNull DatabaseError error) {

                    }
                });

            }

            private void openmain_activity2() {
                Intent intent=new Intent(MedicineSearch.this, MedicineList.class);
                intent.putExtra("email", strEmail);
                startActivity(intent);
            }

        });

    }
    @Override
    public void onBackPressed() {
        String strEmail = getIntent().getStringExtra("email");
        Intent intent=new Intent(MedicineSearch.this, MedicineList.class);
        intent.putExtra("email", strEmail);
        startActivity(intent);

    }
